INSERT INTO `artikel` (`id_artikel`, `penulis`, `tanggal`, `judul`, `id_kategori`, `isi`, `gambar`) VALUES
(2, 'Basketin', 'Selasa, 11 Juni 2024 | 16:52', 'Pelita Jaya Kalah dari Hiroshima Dragonflies di BCL Asia 2024', 1, 'Pelita Jaya Basketball memulai perjalanan mereka di Basketball Champions League (BCL) Asia 2024 dengan hasil kurang memuaskan. Bertanding di Sheikh Saeed Bin Maktoum Sports Hall, Dubai, pada Minggu sore (9/6), Pelita Jaya harus mengakui keunggulan Hiroshima Dragonflies dengan skor 69-86. Tim yang dilatih oleh Johannis Winar tersebut kesulitan menghadapi ketangguhan Dragonflies dalam tembakan jarak jauh.\r\n\r\nDi awal pertandingan, Pelita Jaya tertahan cukup lama, sementara Dragonflies sempat memimpin 16-3 sebelum Pelita Jaya mulai mencetak poin. Namun, sepanjang pertandingan, Pelita Jaya tidak pernah memimpin atas tim asal Jepang tersebut. Salah satu faktor utamanya adalah ketajaman tembakan lawan, di mana Dragonflies berhasil memasukkan 17 dari 37 percobaan tiga angka, dengan persentase 46%. Hal ini menunjukkan bahwa Pelita Jaya kesulitan menghentikan serangan Dragonflies.\r\n\r\nPemain kunci Pelita Jaya untuk BCL Asia 2024, JaQuori McLaughlin, tidak banyak berkontribusi dengan hanya mencetak dua poin. Justin Brownlee menjadi pencetak poin terbanyak bagi tim dengan 12 poin. James Dickey III mencatat double-double dengan 11 poin dan 17 rebound, sedangkan Brandon Jawato menambah 10 poin.\r\n\r\nDi sisi lain, lima pemain Dragonflies mencetak poin dua digit. Toshiki Kamisawa memimpin dengan 20 poin, diikuti oleh Dwayne Evans dengan 18 poin dan 13 rebound. Takuto Nakamura dan Kaine Roberts masing-masing menyumbang 11 poin, sementara Kerry Blackshear Jr. menambah 10 poin, enam rebound, tujuh assist, tiga steal, dan dua block.\r\n\r\nPelita Jaya baru menjalani satu dari tiga pertandingan di babak penyisihan Grup B. Mereka akan kembali bertanding pada Senin (10/6) melawan Shahrdary Gorgan dari Iran. (*)', );
INSERT INTO `artikel` (`id_artikel`, `penulis`, `tanggal`, `judul`, `id_kategori`, `isi`, `gambar`) VALUES
(3, 'timnasputri', 'Selasa, 11 Juni 2024 | 16:56', 'Timnas Basket Putri Indonesia Lolos ke Perempat Final Asian Games 2023 Setelah Kalahkan Mongolia', 2, 'Timnas basket putri Indonesia berhasil lolos ke perempat final Asian Games 2023 setelah meraih kemenangan krusial atas Mongolia. Dalam pertandingan terakhir Grup A, Indonesia menang dengan skor 69-64 melawan Mongolia pada Minggu (1/10/2023).\r\n\r\nKemenangan ini menjadi kemenangan pertama timnas basket putri Indonesia di Hangzhou. Sebelumnya, mereka mengalami kekalahan dari China dan India. Berkat keberhasilan mengalahkan Mongolia, Indonesia finis di posisi ketiga dan melaju ke perempat final sebagai salah satu tim peringkat ketiga terbaik.\r\n\r\nPemain naturalisasi, Kimberly Pierre Louis, menjadi bintang dalam kemenangan penting ini. Kimberly tampil sangat dominan dengan mencetak double-double impresif berupa 44 poin dan 14 rebound.', ),
(4, 'IndonesiaHoops', 'Selasa, 11 Juni 2024 | 17:05', ' Laga Tandang Kesatria Bengawan Solo di IBL 2024', 1, 'Dalam tiga pekan terakhir, Kesatria Bengawan Solo (KBS) melakukan tur ke lima markas lawan mereka. Selama perjalanan panjang ini, tim asuhan Efri Meldi hanya mengalami satu kekalahan, sementara sisanya berhasil mereka menangkan.\r\n\r\nPerjalanan dimulai dari Solo menuju Surabaya. Kentrell Barkley dan timnya bertanding melawan Pacific Caesar Surabaya di GOR Pacific Caesar Surabaya pada 24 Mei lalu, dan meraih kemenangan dengan skor 82-74.\r\n\r\nSetelah Surabaya, perjalanan berlanjut ke Pulau Dewata. Melawan Bali United Basketball di GOR Merpati pada 29 Mei, KBS menang tipis 90-88. Mereka kemudian terbang ke Jakarta untuk menghadapi Pelita Jaya Jakarta di GOR Universitas Negeri Jakarta pada 2 Juni. Sayangnya, KBS tidak mampu menahan serangan Anthony Beane dan timnya, dan kalah dengan skor 69-88.\r\n\r\nSetelah kekalahan dari Pelita Jaya, KBS kembali ke jalur kemenangan. Kali ini, mereka mengalahkan Dewa United Banten dengan skor 111-102 di Dewa United Arena pada 7 Juni. Kemenangan atas Dewa United meningkatkan semangat tim KBS. Pada pertandingan terakhir, mereka berhasil mengatasi perlawanan RANS Simba Bogor di Gymnasium SV IPB pada Minggu (9/6) malam. Samuel Devin dan timnya menang dengan skor 101-82.', );
INSERT INTO `artikel` (`id_artikel`, `penulis`, `tanggal`, `judul`, `id_kategori`, `isi`, `gambar`) VALUES
(5, 'sportsHome', 'Selasa, 11 Juni 2024 | 18:12', 'Stephen Curry , Sang Bintang Golden State Warriors', 3, 'Wardell Stephen Curry II, atau lebih dikenal sebagai Stephen Curry (lahir 14 Maret 1988), adalah pemain basket profesional yang bermain sebagai point guard di NBA (National Basketball Association). Dengan tinggi 191 cm, Curry memiliki kemampuan bola di atas rata-rata. Dia dikenal sebagai salah satu penembak tiga angka terbaik dalam sejarah NBA. Pada musim 2014-2015, Curry memenangkan penghargaan NBA Most Valuable Player (MVP) dan memimpin Golden State Warriors meraih gelar NBA pertama mereka sejak 1975. Pada musim NBA 2016-2017, Curry membawa Warriors ke final NBA untuk ketiga kalinya secara berturut-turut dan memenangkan gelar NBA keduanya.\r\n\r\nCurry adalah putra mantan pemain NBA Dell Curry dan kakak dari pemain NBA saat ini, Seth Curry. Dia bermain basket untuk Davidson College, di mana ia dua kali meraih penghargaan Southern Conference Player of the Year dan mencatatkan rekor skor terbanyak sepanjang masa untuk Davidson dan Konferensi Selatan. Pada tahun keduanya, ia memecahkan rekor NCAA untuk tembakan tiga angka terbanyak dalam satu musim.\r\n\r\nPada musim 2012-2013, Curry mencetak 272 tembakan tiga angka, memecahkan rekor NBA saat itu. Lima tahun kemudian, ia memperbarui rekor tersebut dengan 286 tembakan, dan pada tahun 2016 ia mencetak 402 tembakan tiga angka dalam satu musim. Pada musim 2013-2014, bersama rekan setimnya Klay Thompson, Curry dijuluki sebagai Splash Brothers karena keahlian mereka dalam mencetak tembakan tiga angka, dan mencetak rekor NBA untuk kombinasi tembakan tiga angka dalam satu musim dengan 484 tembakan. Rekor ini mereka pecahkan lagi dalam dua musim berikutnya dengan 525 tembakan pada musim 2014-2015 dan 678 tembakan pada musim 2015-2016. Pada 15 Desember 2021, Curry menjadi pencetak tiga angka terbanyak dalam sejarah NBA dengan 2978 tembakan tiga angka sepanjang karirnya.', ),
(7, 'IndonesiaHoops', 'Selasa, 11 Juni 2024 | 18:31', 'Profil Brooklyn Nets', 4, 'Brooklyn Nets adalah tim basket profesional yang berbasis di Brooklyn, Kota New York. Mereka bersaing di National Basketball Association (NBA) sebagai bagian dari Divisi Atlantik di Wilayah Timur. Pertandingan kandang mereka dimainkan di Barclays Center. Nets adalah salah satu dari dua tim NBA yang berbasis di Kota New York, bersama dengan New York Knicks.\r\n\r\nTim ini didirikan pada tahun 1967 sebagai tim dari liga saingan NBA, American Basketball Association (ABA). Awalnya, mereka bermain di New Jersey dengan nama New Jersey Americans pada musim pertama mereka, kemudian pindah ke Long Island pada tahun 1968 dan berganti nama menjadi New York Nets. Pada periode ini, Nets memenangkan dua gelar ABA pada tahun 1974 dan 1976. Setelah ABA bergabung dengan NBA pada tahun 1976, Nets bersama tiga tim ABA lainnya (San Antonio Spurs, Indiana Pacers, dan Denver Nuggets, yang semuanya masih bermain di NBA hingga kini) ikut pindah ke NBA.\r\n\r\nPada tahun 1977, tim ini kembali ke New Jersey dan dikenal sebagai New Jersey Nets dari tahun 1977 hingga 2012. Selama periode ini, Nets memenangkan dua gelar Wilayah Timur secara berturut-turut pada musim 2001–2002 dan 2002–2003, tetapi tidak berhasil meraih gelar NBA. Pada musim panas 2012, Nets pindah ke Barclays Center dan mengubah nama tim menjadi Brooklyn Nets.\r\n\r\n\r\n\r\n\r\n\r\n', );
INSERT INTO `artikel` (`id_artikel`, `penulis`, `tanggal`, `judul`, `id_kategori`, `isi`, `gambar`) VALUES
(8, 'Basketin', 'Selasa, 11 Juni 2024 | 19:28', 'Mengenal Yesaya Saudale', 3, 'Profil Yesaya Saudale\r\n\r\nNama: Yesaya Alessandro Saudale\r\nTempat Lahir: Denpasar, Bali\r\nTanggal Lahir: 14 Januari 2000\r\nUsia: 22 tahun\r\nTinggi: 178 cm\r\nKlub Saat Ini: Pelita Jaya Bakrie Jakarta\r\n\r\nPenampilan garang Yesaya Saudale antarkan Pelita Jaya Juara Indonesia Cup 2022\r\n\r\nYesaya Saudale mulai mencuri perhatian terutama saat mentas di Indonesia Cup 2022.\r\n\r\nPemain berpososi sebagai point guard ini memiliki catatn mentereng.\r\n\r\nDilansir laman IBL, dia menorehkan catatan RPG 3.17, STPG 2.83, dan PPG 12.17.\r\n\r\n\r\n\r\n', ),
(9, 'timnasputri', 'Selasa, 11 Juni 2024 | 20:29', 'im Basket Putri Berusaha Bangkit Setelah Kekalahan Sengit dari Vietnam di ASG 2024', 2, 'Tim Basket Putri tetap semangat meskipun kalah dari Vietnam dengan skor akhir 86-84 dalam ASEAN School Games (ASG) 2024 di Da Nang, Vietnam, pada Sabtu, dan berusaha bangkit di pertandingan selanjutnya.\r\n\r\nTim Basket Putri mengalami kekalahan di pertandingan pertama penyisihan Grup D setelah kalah dari Vietnam dalam pertandingan yang sangat ketat dengan empat kali babak tambahan waktu atau overtime.\r\n\r\nManajer Tim Basket Putri, Alfa Hari Kusumanegara, mengatakan pertandingan antara Indonesia dan Vietnam berlangsung seimbang, dengan kedua tim menunjukkan kualitas mereka di level ini.\r\n\r\n\"Pertandingan hari ini sangat seimbang antara tim Indonesia dan Vietnam. Kami bertarung sampai empat kali overtime,\" kata Alfa dalam keterangan tertulis.\r\n\r\nMenurutnya, kekalahan Tim Basket Putri disebabkan oleh masalah efektivitas rotasi pemain. Alfa menambahkan bahwa rotasi pemain akibat empat kali overtime membuat situasi di lapangan kurang optimal.\r\n\r\nMeski kalah di pertandingan pertama, Alfa yakin peluang Indonesia melaju ke babak selanjutnya di ASG 2024 masih terbuka. Untuk menjaga peluang itu, Alfa menyatakan para pemain harus meraih kemenangan di pertandingan kedua melawan Singapura.\r\n\r\nPertandingan melawan Singapura akan berlangsung pada 4 Juni 2024. Jika menang, Indonesia akan melaju ke babak semifinal.\r\n\r\n\"Kita masih punya kesempatan melawan tim Singapura. Jika menang, kita akan lolos ke babak berikutnya. Mohon doa dari masyarakat Indonesia untuk perjuangan kami saat menghadapi Singapura,\" ujarnya.\r\n\r\nSementara itu, Tim Basket Putra akan melawan Filipina pada Minggu (2/6) dalam kompetisi yang sama. Pertandingan ini penting untuk dimenangkan Indonesia agar menjaga peluang ke semifinal.\r\n\r\nSaat ini, Tim Basket Putra Indonesia telah meraih satu kemenangan atas Laos. Filipina juga meraih satu kemenangan atas Thailand dengan skor 78-62. Pemenang pertandingan ini akan memastikan tiket ke semifinal cabang olahraga Bola Basket pada ASG 2024.', );

